public int zonesQueued() {
  int ret = 0;
  for (Map.Entry<Long, ZoneReencryptionStatus> entry : zoneStatuses
      .entrySet()) {
    if (entry.getValue().getState() == State.Submitted) {
      ret++;
    }
  }
  return ret;
}
